import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import MainLayout from './components/MainLayout';
import Home from './pages/Home'; // AI Chat component
import UploadDataPage from './pages/UploadDataPage';
// import DatabasePage from './pages/DatabasePage'; // Assuming this is another page
// import SettingsPage from './pages/SettingsPage'; // Assuming this is another page

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<MainLayout />}>
                    <Route index element={<Home />} /> {/* AI Chat Dialog as default */}
                    <Route path="upload" element={<UploadDataPage />} />
                    {/* <Route path="database" element={<DatabasePage />} />
                    <Route path="settings" element={<SettingsPage />} /> */}
                </Route>
            </Routes>
        </Router>
    );
};

export default App;
